const Table = () => {
  const data = [
   {}
   
  ]

  return (
    <div>
      <table>
        <tbody>
          {data.map((el, i) => {
            return (
              <tr name={el.day} key={i}>
                <td>{el.time}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
